import React from "react";

const AddNewButton = ({ newKey }) => {
  const PopUp = () => {
    return window.prompt("");
  };

  return (
    <button className="ui icon button" onClick={() => newKey(PopUp())}>
      <i className="plus icon" />
    </button>
  );
};

export default AddNewButton;
